    if (userRank === "Silver Merchant") {
        messages.push({
            id: "celebration-1",
            sender: "The Royal Court",
            title: "You Have Ascended to Silver Merchant!",
            content: "Hail! The kingdom rejoices in your promotion! You have proven your commitment to financial wisdom and earned the title of Silver Merchant. New advisors and building upgrades now await you. Your reign grows stronger!",
            type: "celebration",
            date: formatDate(today),
            icon: "🎖️",
            read: false
        });
    }
    if (userRank === "Gold Advisor") {
        messages.push({
            id: "celebration-2",
            sender: "The King Himself",
            title: "Welcome, Gold Advisor!",
            content: "You have risen to the prestigious rank of Gold Advisor! Your financial acumen is now legendary throughout the realm. I am proud to grant you access to our most powerful financial tools and strategies. The kingdom is in excellent hands.",
            type: "celebration",
            date: formatDate(today),
            icon: "👑",
            read: false
        });
    }
    if (userRank === "Diamond Magnate") {
        messages.push({
            id: "celebration-3",
            sender: "The King Himself",
            title: "All Hail the Diamond Magnate!",
            content: "You have reached the pinnacle of financial excellence! As Diamond Magnate, you stand among the greatest wealth builders in our kingdom. Your wisdom shall guide future generations. You have earned the ultimate respect and resources of the realm!",
            type: "celebration",
            date: formatDate(today),
            icon: "💎",
            read: false
        });
    }
